import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


class createBookmark extends Component {
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(event){
        event.preventDefault();
        const bookmark = {
            "name": document.getElementById("name").value,
            "rating": document.getElementById("rating").value,


        };
        fetch('/bookmarks/create', {
            method: 'post',
            headers: {'Content-Type':'application/json'},
            body: JSON.stringify(bookmark)
        });
    }

    render(){
        return(<div className="container">
            <form className="align-content-center">
                <div className="form-group">
                    <input type="text" className="form-control" id="name" aria-describedby="Bookmark Name" alt="Bookmark Name"/>
                </div>
                <button type="" onClick={this.handleSubmit} className="btn btn-primary ">Add bookmark</button>

            </form>
            <form>


            </form>
        </div>)
    }
}
export default createBookmark;
